import React from 'react';
import './ImageLinkForm.css'

const ImageLinkForm = ({onInputChange, onSubmit}) => {
    return (
        <div className='imageform w-100 tc'>
            <p className='f3 tc'>
                Give it a try!
            </p>
            <div>
                <input className="bg-gray" type='text' onChange={onInputChange} />
                <button className="link grow pointer ml1" onClick={onSubmit}>Detect</button>
            </div>
        </div>
    );
}

export default ImageLinkForm
